using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public partial struct VelocityComponentResolver : IResolver<VelocityComponent>, IResolver<VelocityComponentResolver,VelocityComponent>, IData	{		public VelocityComponentResolver In(ref VelocityComponent velocitycomponent)		{			return this;		}		public void Out(ref Entity entity)		{			var local = entity.GetComponent<VelocityComponent>();			Out(ref local);		}		public void Out(ref VelocityComponent velocitycomponent)		{		}	}}